import '../App.css';
import horses from '../images/horses.jpeg';
import lemurs from '../images/lemurs.jpeg';
import lionness from '../images/lionness.jpeg';
import lions from '../images/lions.jpeg';
import lontra from '../images/lontra.jpeg';
import monkeys from '../images/monkeys.jpeg';
import owls from '../images/owls.jpeg';
import owls2 from '../images/owls.jpeg';
import pandas from '../images/pandas.jpeg';
import penguins from '../images/penguins.jpeg';
import polarBear from '../images/polarBear.jpeg';
import squirrels from '../images/squirrels.jpeg';
import swans from '../images/swans.jpeg';
import Tartoise from '../images/Tartoise.jpeg';
import wildDoggo from '../images/wildDoggo.jpeg';
import Bats from '../components/Bats';
import Cheetah from '../components/Cheetah';
import Bears2 from '../components/Bears2';
import Bears from '../components/Bears';
import Bears3 from '../components/Bears3';
import Bears4 from '../components/Bears4';
import Animals from '../components/Animals';
import Buffalo from '../components/Buffalo';
import Camels from '../components/Camels';
import Cats from '../components/Cats';
import Chips from '../components/Chips';
import Cows from '../components/Cows';
import Doggo from '../components/Doggo';
import Elephant from '../components/Elephant';
import Giraffe from '../components/Giraffe';
import Gorillaz from '../components/Gorillaz';
import Gorillaz2 from '../components/Gorillaz2';
import Gorillaz3 from '../components/Gorillaz3';
import Hippos from '../components/Hippos';


const App = () => {
  return (
    <div className="container">
        <div class="header">
          <h1>The Mother</h1>
        </div>
        <div id="gallery">
          <Animals />
          <Bats />
          <Cheetah />
          <Bears />
          <Bears2 />
          <Bears3 />
          <Bears4 />
          <Buffalo />
          <Camels />
          <Cats />
          <Chips />
          <Cows />
          <Doggo />
          <Elephant />
          <Giraffe />
          <Gorillaz />
          <Gorillaz2 />
          <Gorillaz3/>
          <Hippos />
          <img src={horses} />
          <img src={lemurs} />
          <img src={lionness} />
          <img src={lions} />
          <img src={lontra} />
          <img src={monkeys} />
          <img src={owls} />
          <img src={owls2} />
          <img src={pandas} />
          <img src={penguins} />
          <img src={polarBear} />
          <img src={squirrels} />
          <img src={swans} />
          <img src={Tartoise} />
          <img src={wildDoggo} />
        </div>
    </div>
  )
}

export default App;
